import React from 'react';
import Home from "./Home";

export default function UserList ( {addContact} ){
    return(
        <div>
            {props.userList.map((contact) => (
                <div key={contact.phone}>
                    <p>{contact.first_name}</p>
                    <p>{contact.last_name}</p>
                    <p>{contact.email}</p>
                    <p>{contact.phone}</p>
                </div>
            ))}
        </div>
    )
}
